import React, { useState } from 'react';
import axios from 'axios';
import { QuoteDownloadLink } from './QuotePDF';

const QuoteTool = () => {
  const [type, setType] = useState('lawncare');
  const [area, setArea] = useState('');
  const [options, setOptions] = useState({
    hillside: false,
    pushMowing: false,
    weedWhacking: false,
  });
  const [quote, setQuote] = useState(null);
  const [customerInfo, setCustomerInfo] = useState({
    name: '',
    address: '',
  });

  const handleCalculateQuote = async () => {
    try {
      const response = await axios.post('http://localhost:5000/api/quotes/calculate', {
        type,
        area: parseFloat(area),
        options,
      }, {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
      });
      setQuote(response.data);
    } catch (error) {
      console.error('Error calculating quote:', error);
    }
  };

  return (
    <div className="quote-tool p-6 bg-gray-800 text-white rounded-lg shadow-lg">
      <h2 className="text-2xl mb-4">Quoting Tool</h2>
      <div className="tabs mb-4">
        {['lawncare', 'hedge_trimming', 'landscaping'].map(t => (
          <button
            key={t}
            onClick={() => setType(t)}
            className={`mr-2 p-2 ${type === t ? 'bg-blue-500' : 'bg-gray-600'} rounded`}
          >
            {t.replace('_', ' ')}
          </button>
        ))}
      </div>
      <div className="quote-form mb-4">
        <label className="block mb-2">
          Area (sq ft):
          <input
            type="number"
            value={area}
            onChange={e => setArea(e.target.value)}
            className="ml-2 p-2 rounded text-black"
          />
        </label>
        <label className="block mb-2">
          Hillside:
          <input
            type="checkbox"
            checked={options.hillside}
            onChange={e => setOptions({ ...options, hillside: e.target.checked })}
            className="ml-2"
          />
        </label>
        <label className="block mb-2">
          Push Mowing:
          <input
            type="checkbox"
            checked={options.pushMowing}
            onChange={e => setOptions({ ...options, pushMowing: e.target.checked })}
            className="ml-2"
          />
        </label>
        <label className="block mb-2">
          Weed Whacking:
          <input
            type="checkbox"
            checked={options.weedWhacking}
            onChange={e => setOptions({ ...options, weedWhacking: e.target.checked })}
            className="ml-2"
          />
        </label>
        <button
          onClick={handleCalculateQuote}
          className="bg-green-500 text-white px-4 py-2 rounded mt-4"
        >
          Calculate Quote
        </button>
      </div>
      {quote && (
        <div className="quote-result">
          <h3 className="text-xl mb-4">Quote Result</h3>
          <p>Base Price: ${quote.basePrice.toFixed(2)}</p>
          <p>Additional Price: ${quote.additionalPrice.toFixed(2)}</p>
          <p>Total Price: ${quote.totalPrice.toFixed(2)}</p>
          <label className="block mb-2">
            Customer Name:
            <input
              type="text"
              value={customerInfo.name}
              onChange={e => setCustomerInfo({ ...customerInfo, name: e.target.value })}
              className="ml-2 p-2 rounded text-black"
            />
          </label>
          <label className="block mb-2">
            Customer Address:
            <input
              type="text"
              value={customerInfo.address}
              onChange={e => setCustomerInfo({ ...customerInfo, address: e.target.value })}
              className="ml-2 p-2 rounded text-black"
            />
          </label>
          <QuoteDownloadLink quote={quote} customerInfo={customerInfo} />
        </div>
      )}
    </div>
  );
};

export default QuoteTool;
